import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SearchService {
  #searchedGenres: any[];
  constructor() {
    this.#searchedGenres = [];
  }
  set setSearchedGenres(genres: any[]) {
    this.#searchedGenres = genres;
  }
  get getSearchedGenreNames(): any[] {
    return this.#searchedGenres;
  }
}
